function getUserInfo(match,repeat){
	user_data['user_level'] = match[23];
	user_data['user_health'] = match[3];
	user_data['user_max_health'] = match[5];
	user_data['user_energy'] = match[7];
	user_data['user_max_energy'] = match[9];
	user_data['user_stamina'] = match[11];
	user_data['user_max_stamina'] = match[13];
	user_data['user_experience'] = match[19];
	user_data['exp_for_next_level'] = match[21];
	document.getElementById('user_level').innerHTML = user_data['user_level'];
	document.getElementById('user_health').innerHTML = user_data['user_health'];
	document.getElementById('user_energy').innerHTML = user_data['user_energy'];
	document.getElementById('user_stamina').innerHTML = user_data['user_stamina'];
	document.getElementById('user_expirience').innerHTML = (parseInt(user_data['user_experience'],10) - parseInt(user_data['exp_for_next_level'],10));
}

function reheal(){
//	alert('aaa')

	if (parseInt(GM_getValue('health_points','20'),10) >= parseInt(user_data['user_health'],10)){
		var city = parseInt(citys[GM_getValue('heal_city','city_ny')],10) == 1 ? '2' : citys[GM_getValue('heal_city','city_ny')];
		GM_xmlhttpRequest({
			url:app_links.mw_link + '?xw_controller=travel&xw_action=travel&xw_city=' + city + '&skip_req_frame=1&sf_xw_user_id=' + xw_user + '&sf_xw_sig=' + xw_sig + '&cb=0&destination=' + citys[GM_getValue('heal_city','city_ny')] + '&from=hospital', 
			method:'get',
			onload: function(response){
				GM_xmlhttpRequest({
					url:app_links.mw_link + '?xw_controller=hospital&xw_action=heal&xw_city=' + citys[GM_getValue('heal_city','city_ny')] + '&skip_req_frame=1&sf_xw_user_id=' + xw_user + '&sf_xw_sig=' + xw_sig + '&cb=0', 
					method:'get',
					onload: function(response_text){
						var match = response_text.responseText.toString().split(/user_fields\[.*\].*\"(.*?)\"/g);
						var q = timestamp().toString();
						var iframe_html = mwwah_plainHTML(response_text.responseText.toString());
						var user_profile_obj = mwwah_createElement('div',null,null);
						user_profile_obj.innerHTML = iframe_html;
						var user_profile_html_td = user_profile_obj.getElementsByTagName('td');
						var array_count = 0;
						var messages_array = new Array();
						for (i = 0; i < user_profile_html_td.length; i++){
							if (user_profile_html_td[i].className == 'message_body'){
								messages_array[array_count] = user_profile_html_td[i].innerHTML;
								array_count++;
							}
						}
						var get_message_array = getMessages(messages_array,q);
						if (get_message_array != null){
							if (messages_array.length > 0){
								if (log_html_content.getElementsByTagName('div')[0]){
									log_html_content.insertBefore(mwwah_createActionLogRecordHeal(q,get_message_array),log_html_content.getElementsByTagName('div')[0]);
								}else{
									log_html_content.appendChild(mwwah_createActionLogRecordHeal(q,get_message_array));
								}
							}
						}
						getUserInfo(match,'stop');
					}
				});
			}
		});
	}
}

