function mwwah_plainHTML(html){
	for (var i in plain_html_pattern){
		html = html.replace(plain_html_pattern[i].pattern,plain_html_pattern[i].replace);
	}
	return html;
}

function mwwah_createTabs(tabs_array,obj_prefix,short_name){
	var tab_container = mwwah_createElement('div',null,{'id':'tab_container_' + obj_prefix});
	for (var i in tabs_array ){
		if (tabs_array[i].visibility == true){
			var tab_name = short_name ? firstLetter(tabs_array[i].name) : tabs_array[i].name ;
			
//			var tab-content_class = document.getElementById('home_stream') != undefined ? 'tab-content' : 'tab-content-new' ;
			if (tabs_array[i].city > 0){
				var tab_element = mwwah_createElement('div',tab_container,{'class':'tab-content','style':'background:#181818 url(' + stripURI(_appImg['city_' + tabs_array[i].city]) + ') left bottom no-repeat'});
			}else{
				var tab_element = mwwah_createElement('div',tab_container,{'class':'tab-content'});
			}
			var tab_element_title = mwwah_createElement('h1',tab_element,{'class':'tab','title':tabs_array[i].name});
			var _tab_element_title = document.createTextNode(tab_name);
			tab_element_title.appendChild(_tab_element_title);
			var tab_element_content = mwwah_createElement('p',tab_element,null);
			tab_element_content.appendChild(mwwah_createStatisticTabBody(tabs_array[i],obj_prefix));
		}
	}
	return tab_container;
}

function mwwah_createStatisticTabBody(obj,obj_prefix){
	var body_table = mwwah_createElement('table',null,{'width':'100%','cellspacing':'1','cellpadding':'0','border':'0'});
	var body_tr = mwwah_createElement('tr',body_table,null);
	var body_th1 = mwwah_createElement('th',body_tr,{'width':'50%'});
	var body_th2 = mwwah_createElement('th',body_tr,{'width':'25%','align':'center'});
	body_th2.innerHTML = 'Times';
	var body_th3 = mwwah_createElement('th',body_tr,{'width':'25%','align':'center'});
	body_th3.innerHTML = 'Total times';
	for (var i in obj.fields ){
		var percent = i == 'percent' ? '%' : '' ;
		var city = obj.city >0 ? '_' + obj.city : '' ;
		var body_tr = mwwah_createElement('tr',body_table,null);
		if (obj.images == true && boosts_height != null){
			var td_attr = {'height':boosts_height,'style':'background:url(' + stripURI(_appImg['boost' + i]) + ') left center no-repeat','class':'stat_tdh1_' + obj_prefix + ' ' + i};
		}else{
			var td_attr = {'class':'stat_td1_' + obj_prefix + ' ' + i};
		}
		var body_td1 = mwwah_createElement('td',body_tr,td_attr);
		body_td1.innerHTML = obj.fields[i];
		var value_id = obj.type + city + '_' + i + '_value';
		var body_td2 = mwwah_createElement('td',body_tr,{'align':'center','id':value_id,'class':'stat_td2_' + obj_prefix + ' ' + i});
		body_td2.innerHTML = GM_getValue(value_id,0) + percent;
		var total_id = obj.type + city + '_' + i + '_total';
		var body_td3 = mwwah_createElement('td',body_tr,{'align':'center','id':total_id,'class':'stat_td3_' + obj_prefix + ' ' + i});
		body_td3.innerHTML = GM_getValue(total_id,0) + percent;
	}
	return body_table;
}

function mwwah_objInsert(newChild,refChild,posChild){
	if (posChild == 'prev'){
		refChild.parentNode.insertBefore(newChild,refChild.previousSibling);
	}else if (posChild == 'prev1'){
		refChild.parentNode.insertBefore(newChild,refChild);
	}else if (posChild == 'next'){
		refChild.parentNode.insertBefore(newChild,refChild.nextSibling);
	}
} 

function dynamicClick(){
	if (this.getAttribute('objevent') == 'tab_about'){
		var dialog_content = tab_about();
	}else if (this.getAttribute('objevent') == 'tab_settings'){
		var dialog_content = tab_settings();
	}else if (this.getAttribute('objevent') == 'tab_donate'){
		var dialog_content = tab_donate();
	}else if (this.getAttribute('objevent') == 'tab_wallaction'){
		var dialog_content = tab_wallaction();
	}
	showDialog(this,425,this.innerHTML,dialog_content,top_menu[this.getAttribute('objid')].buttons,null,true);
	if (this.getAttribute('objtab') != ''){
		BuildTabs(this.getAttribute('objtab'));
		ActivateTab(this.getAttribute('objtab'),0);

	}
}

function mwwah_createElement(type,append,attr){
	var element = document.createElement(type);
	if (attr != null){
		for (var i in attr){
			element.setAttribute(i,attr[i]);
		}
	}
	if (append){
		append.appendChild(element);
	}
	return element;
}

