function getElementsByClassName(obj,tag,clsName){
	var retVal = new Array();
	var elements = obj.getElementsByTagName(tag);
	for(var i = 0;i < elements.length;i++){
		if(elements[i].className.indexOf(' ') >= 0){
			var classes = elements[i].className.split(' ');
			for(var j = 0; j < classes.length; j++){
				if(classes[j] == clsName){
					retVal.push(elements[i]);
				}
			}
		}else{
			if(elements[i].className == clsName){
				retVal.push(elements[i]);
			}
		}
	}
	return retVal;
}

function getElementsByStyles(obj,tag,attrValue){
	var retVal = new Array();
	var elements = obj.getElementsByTagName(tag);
	for(var i = 0;i < elements.length; i++){
		if (elements[i].getAttribute('style') != null){
			if (elements[i].getAttribute('style') == attrValue){
				retVal.push(elements[i]);
			}
		}
	}
	return retVal;
}

function removeElementsByClassName(classname){
	node = document.getElementsByTagName("body")[0];
	var pattern = new RegExp('\\b' + classname + '\\b');
	var obj = node.getElementsByTagName("*");
	for(var i = 0, j = obj.length; i < j; i++){
		if (typeof obj[i] == 'object'){
			if (pattern.test(obj[i].className)){
				obj[i].parentNode.removeChild(obj[i]);
			}
		}
	}
}

