function showDialog(obj,width,title,message,buttons,type,close) {
	var dialog, dialog_header, dialog_close, dialog_title, dialog_content, dialog_mask, dialog_hr, dialog_buttons_pannel, dialog_buttons;
	type = type != null ? type : '';
	width = width ? width : 425 ;
	dialog_mask = mwwah_createElement('div',document.body,{'id':'dialog-mask'});
	dialog = mwwah_createElement('div',document.body,{'id':'dialog','style':'width:' + width + 'px'});
	dialog_header = mwwah_createElement('div',dialog,{'id':'dialog-header','class':'header','style':'width:' + (width - 13) + 'px'});
	dialog_title = mwwah_createElement('div',dialog_header,{'id':'dialog-title'});
	if (close){
		dialog_close = mwwah_createElement('div',dialog_header,{'id':'dialog-close'});
		dialog_close.addEventListener('click',removeDialog, false);
	}
	dialog_content = mwwah_createElement('div',dialog,{'id':'dialog-content','class':type});
	if (count(buttons) > 0){
		dialog_hr = mwwah_createElement('hr',dialog,null);
		dialog_buttons_pannel = mwwah_createElement('div',dialog,{'class':'dialog-buttons-pannel'});
		krsort(buttons);
		for (var i in buttons){
			dialog_buttons = mwwah_createElement('button',dialog_buttons_pannel,{'class':'dialog-buttons','action':buttons[i].action});
			dialog_buttons.innerHTML = buttons[i].name;
			dialog_buttons.addEventListener('click',clickDialogButton, false);
		}
	}
	var width = pageWidth();
	var height = pageHeight();
	var left = leftPosition();
	var top = topPosition();
	var dialog_width = dialog.offsetWidth;
	var dialog_height = dialog.offsetHeight;
	var topposition = top + (height / 3) - (dialog_height / 2);
	var leftposition = left + (width / 2) - (dialog_width / 2);
	dialog.style.top = topposition + 'px';
	dialog.style.left = leftposition + 'px';
	dialog_title.innerHTML = title;
	if (typeof message == 'string'){
		dialog_content.innerHTML = message;
	}else if (typeof message == 'object'){
		dialog_content.appendChild(message);
	}
	var content = document.getElementById(WRAPPER);
	dialog_mask.style.height = content.offsetHeight + 'px';
}

function clickDialogButton(){
	eval(this.getAttribute('action'));
}

function removeDialog() {
	document_body = document.body;
	dialog_obj = document.getElementById('dialog');
	dialog_mask_obj = document.getElementById('dialog-mask');
	document_body.removeChild(dialog_obj);
	document_body.removeChild(dialog_mask_obj);
}

function krsort (array, sort_flags) {
	var tmp_arr={}, keys=[], sorter, i, key, that=this;
	switch (sort_flags) {
		case 'SORT_STRING':
			sorter = function (a, b) {
				return that.strnatcmp(b, a);
			};
			break;
		case 'SORT_LOCALE_STRING':
			var loc = this.i18n_loc_get_default();
			sorter = this.php_js.i18nLocales[loc].sorting;
			break;
		case 'SORT_NUMERIC':
			sorter = function (a, b) {
				return (b - a);
			};
			break;
		case 'SORT_REGULAR':
		default:
			sorter = function (a, b) {
				if (a < b) {
					return 1;
				}
				if (a > b) {
					return -1;
				}
				return 0;
			};
			break;
	}
	for (key in array) {
		keys.push(key);
	}
	keys.sort(sorter);
	for (i = 0; i < keys.length; i++) {
		key = keys[i];
		tmp_arr[key] = array[key];
		delete array[key];
	}
	for (i in tmp_arr) {
		array[i] = tmp_arr[i];
	}
	return true;
}

